// going to show games
import React, { Component } from "react";
import "../style/game.css";

class Game extends Component {
  render() {
    return (
      <div className="card">
        <div className="card-image-title">
          <h1 className="card-title marginLeft">
            {this.props.game.title  !== undefined ? this.props.game.title : ""}
          </h1>
        </div>
        <div className="card-content marginLeft">
          <p>
            {this.props.game.description !== undefined ? this.props.game.description : ""}
          </p>
          <p>{this.props.game.progress  !== undefined ? this.props.game.progress : ""}%</p>
        </div>
        <div className="card-action">
          <button className="play marginLeft">Play</button>
          <button className="reset">Reset</button>
        </div>
      </div>
    );
  }
}

export default Game;
